import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { Route, Switch } from 'react-router-dom';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Categories from './Pages/Categories';
import Login from './Pages/Login';
import Register from './Pages/Register';
import LogOut from './Pages/LogOut';
import Profile from './Pages/Profile';
import Owned from './Pages/Owned';
import Details from './Pages/Details';
import Edit from './Pages/Edit';
import CreateSell from './Pages/CreateSell';
// import EditProfile from './Pages/EditProfile';
import Error404 from './Pages/Error404';
import Messages from './Pages/Messages'

function App() {
   return (
      <>
         <Header />
         <Switch>
            <Route path="/" exact component={Categories} />
            <Route path="/market/:category" exact component={Categories} />
            <Route path="/owned/:publicAddress/:category/" component={Owned} />
            <Route path="/nft/:contractAddress/:tokenId/details" component={Details} />
            <Route path="/nft/:contractAddress/:id/edit" component={Edit} />
            <Route path="/auth/login" exact component={Login} />
            {/* <Route path="/auth/register" exact component={Register} /> */}
            {/* <Route path="/auth/logout" exact render={LogOut} /> */}
            {/* <Route path='/add-product' exact component={CreateSell} />; */}
            {/* <Route path='/assets/:id' exact component={Owned} />; */}
            {/* <Route path='/profile/:id/edit' exact component={EditProfile} />; */}
            {/* <Route path='/messages' exact component={Messages} />;
            <Route path='/messages/:id' exact component={Messages} />; */}
            <Route component={Error404} />
         </Switch>
         <Footer />
      </>
   );
}

export default App;
